function mapDispatchToProps(dispatch) {
  return {
    login: () => {
      dispatch({ type: "LOGIN" });
    },
    logout: () => {
      dispatch({ type: "LOGOUT" });
    },
    textInput: (value) => {
      dispatch({ type: "ADD_CONTENT", addContent: value });
    },
    collections: (value) => {
      dispatch({tp})
    }
  };
}

export default mapDispatchToProps;
